INSERT INTO `sites` VALUES (2,'Baycite (Voila 3081)','BAYCT','19.05623000000000','-72.01707000000000','-9.95458000000000','Guard\'s name 555-5555-5555',3,'2012-09-28 00:00:00',2,20,1,3,1,1,1,7,10,NULL,NULL,'Transversal installed weather-tight enclosure for Inveneo router-switch board March 2012. Was cabinet.','Standard triangular Voila tower. Platform?','Beam clamps','Steep, rough dirt road. High clearance 4x4 required. Key no longer needed for access to Inveneo equipment on site.','Cyber-training center of George/Pierre in Hinche','L\'Hermitage Pandiassou hotel just outside of Hinche (call ahead)','(Old notes - done?) Need to move CBRIT dish to other side of tower. When you are up there, switch HINCH radio to sta to get a link up',9,'2012-11-27 18:15:09',NULL),(8,'Belladere (Voila 3082)','BELDR','18.85092000000000','-71.78593000000000','-10.05442000000000','',1,NULL,2,20,1,NULL,NULL,NULL,1,6,12,NULL,NULL,'','Standard triangular Voila tower with platform','Existing standoffs, plus 1 pole mounted with beam clamps just below the platform on the NW side. Pole is necessary to get away from a large grill dish (non-Viola) mounted on one of the standoffs.','Short, steep dirt road, 4x4 recommended','','Germain guest house','',9,'2012-11-30 09:13:04',NULL),(12,'Bellevue (Voila 3001)','BELVU','18.36383700000000','-72.90718000000000','-9.37331000000000','Louis Claudy: 4412-1206, 4849-7523, 4742-0908 ',1,NULL,9,15,10,1,1,1,1,5,13,NULL,NULL,'','Small, old, very crowded triangular tower','Numerous abandoned round standoffs. Beam clamps may not work due to the large number of other antennas already present. Custom standoffs may be needed.','Foot, donkey or helicopter (verified). Road destroyed in landslide past Chamer?','On site','Bring tent and water.','',1,'2013-02-20 11:03:39',NULL),(13,'Boucan Carré (Voila 3083)','BCARE','18.92106118000000','-72.14426114000000','-9.86390000000000','',1,NULL,2,20,1,3,1,1,1,5,11,NULL,NULL,'','','Beam clamps','','','','8-port H3C DC switch:\r\n- port 1 (vlan 11) - BCARE-BOSIO\r\n- port 2 (vlan 12) - BCARE-100\r\n- port 3 (vlan 12) - BCARE-340\r\n- port 9 - trunk to Mikrotik',9,'2012-11-28 05:00:23',NULL),(15,'Morne Herve','HDC225','18.95719000000000','-72.37142000000000','-9.74411000000000','Samuel MORALES 3-688-7229',3,'2012-12-10 00:00:00',6,15,10,1,2,3,1,5,68,NULL,NULL,'Freestanding Tower w Round Members.','Mountain top site with high CBS walls.','','On the road from VERRETTES to MIREBALAIS, after DESARMES, after concrete bridge over Riviere MORUE. Entrance is on the left hand side. It is the same entrance as the entrance to the VOILA Site of JANVI. Very Rough Road, Very Steep and slippery uphill road. Requires a Good 4x4 and skilled driver. Site Guardian lives on main road atop hill past the bridge, before the entrance to teh site.','','','RBS Type =  2106I',1,'2012-12-10 06:31:00',NULL),(16,'Delpeche','DLPCH','18.92640000000000','-72.54260000000000','-9.65832000000000',NULL,1,NULL,9,15,6,1,1,1,1,5,50,6,NULL,NULL,NULL,'Three side mounts ',NULL,NULL,NULL,NULL,1,'2013-01-23 17:19:49',NULL),(17,'Vandal','HDS007','18.35244000000000','-72.58594000000000','-9.55135000000000','Dene POLISSAINT 3-757-0685',1,'2012-11-12 00:00:00',7,15,10,1,1,2,1,5,58,14,NULL,'Freestanding Tower w/L-BAR.','Small Mountain Top Site w/Freestanding tower. Located right next door of the BERNA VOILA Site.','Beam Clamps & Pipe Grabs.','On the road to JACMEL, after FONDWA, right before KM 24, turn right on small dirt road. Would normally require 4x4 to go up the hill. Presently road is completely destroyed, and not drivable. Have to park right at the entrance of the road and hike. Short 5 minutes hike to site.','','','RBS Type =  2106I',1,'2013-02-02 18:51:45',NULL),(18,'Belle Plaine','HDN008','19.72122000000000','-72.22322000000000','-9.95415000000000','Alter JEAN - 3-753-5387',1,NULL,2,15,10,NULL,2,3,1,5,74,28,NULL,'','','','','','','RBS Type = 2106\r\nSite Survey, Outdoor Enclosure and Power Install done by Team 20 on December 19th 2012.',1,'2013-01-22 17:21:03',NULL),(19,'Limbe','HDN208','19.70678000000000','-72.40367000000000','-9.85153000000000','Harold PROPHETE - 3-753-8664',1,NULL,2,15,10,NULL,1,2,1,5,78,31,NULL,'','','','','','','RBS Type =  2106I\r\nSite Survey, Outdoor Enclosure and Power Install done by Team 20 on December 19th 2012.',1,'2013-01-22 17:20:46',NULL),(20,'Frecyneau','HDC004','19.08672000000000','-72.71794000000000','-9.58413000000000','Rosemene ALFRED 3-791-5955',1,NULL,6,15,10,1,1,2,1,5,79,32,NULL,'L-BAR Freestanding Tower','Clean Mountain Top Site Fully Fenced w/High CBS Wall. Very Remote. No houses close by. ','Beam Clamps & Pipe Grabs.','At the Entrance of SAINT-MARC, look for the LA COLLINE HOTEL Sign on the right hand side of the road. Turn Right on the Road to LA COLLINE HOTEL, and go up the hill. Should see tower on the right once past the hotel. Follow the dirt road to the site. Site Guardian lives on the National Road, past the Hotel, across the road from TOTAL Gas Station. Should call the Site Guardian once reach MONTROUIS to coordinate meeting at the entrance road to LA COLLINE HOTEL, and go up together.\r\n','','','RBS Type = 2106',1,'2013-01-29 18:45:14',NULL),(21,'Dessalines','HDC260','19.26019000000000','-72.51653000000000','-9.70718000000000','Jose MCDonald 3-787-7529',3,'2012-12-10 00:00:00',6,15,10,1,2,3,1,5,71,24,NULL,'Freestanding Tower w/Round Bar Members.','In-City Site with High CBS wall Fence.','Custom Standoffs.','From Route Nationale No1, turn right after L\'ESTERE on road to MARCHAND DESSALINES. Site is in the center of town, Past Town Square, site sits on Rue Jacques Premier, beetween Rue B. CANAL & Rue GABARD.\r\nSite Guardian lives close by.','','','RBS Type = 2106',1,'2012-12-10 06:30:15',NULL),(22,'Estere','HDC274','19.30222000000000','-72.60956000000000','-9.66090000000000','DORMEVIL 3-850-0808 / TAMARA 3-629-4351',1,'2012-12-06 00:00:00',6,15,10,2,2,3,1,5,72,23,NULL,'Guyed Tower On Roof of 2-Story Building.','Roof Top Site w/Guyed Tower.','','On Route National No.1, in the center of town of L\'ESTERE, across from market. On the right hand side when heading north. Have to go on the right side of the house to the back where there is a concrete staircase leading to the second floor. From Second Floor climb up metallic ladder to roof.','','','RBS Type =  2106I',1,'2012-12-10 06:35:41',NULL),(23,'Pont Sonde','HDC263','19.15114000000000','-72.61242000000000','-9.63527000000000','Louisdes DOR 3-614-0781',1,NULL,6,24,10,1,2,3,1,5,67,21,NULL,'Round Bar Free Standing Tower.','In-Town Site, Fully Fenced with High CBS Walls. On the side of the road.','Customer Stand Offs.','At PONT SONDE, take road to VERRETTES. Site Half A Mile on the left hand side of the road. Site Guardian lives close by further down the road.','','','RBS Type =  2106I',1,'2012-12-03 05:48:15',NULL),(24,'Liancourt','HDC264','19.12856000000000','-72.54686000000000','-9.66917000000000','SANDY or EMMANUEL 3-785-1647',1,'2012-12-04 00:00:00',6,24,10,1,2,3,1,5,69,26,NULL,'Free Standing Round Member Tower.','Fully Fenced In-City Site w/High CBS Walls.','Custom Standoffs.','On the road from PONT SONDE to VERRETTES, at the entrance of LIANCOURT, watch for 1st Speed Bump. Should see tower on the left. Turn On First Road on the left, right after the speed bump, then make first right. The site will be on the right hand side. Site Guardian lives near by.','','','RBS Type =  2106',1,'2012-12-04 14:49:55',NULL),(25,'Pont Vincent','HDC280','19.12258000000000','-72.47814000000000','-9.70838000000000','LOUISNORD 3-661-8850',1,'2012-12-10 00:00:00',6,15,10,1,2,3,1,5,73,22,NULL,'Freestanding Tower with Round Members.','In-City Site with High CBS walls.','Custom Standoffs.','On the center of town of PETITE RIVIERE DE L\'ARTIBONITE, turn left on side road, right after the NATCOM Guyed Tower. Road leads to 14eme section. Site on the left hand side of the road.\r\n','','','RBS Type =  2116_V2   ',1,'2012-12-10 06:31:33',NULL),(26,'Verrettes','HDC267','19.05200000000000','-72.46558000000000','-9.70455000000000','Octavius CEUS 3-785-1649',1,'2012-12-04 00:00:00',6,15,10,1,2,3,1,5,70,25,NULL,'Freestanding Tower with Round Member.','In-City Site Fully Fenced w/High CBS Walls.','Custom Standoffs.','At VERRETTES, turn right on Rue Dumarsais ESTIME. Site on the right hand side behind a regular house gate. Site is in the back of the house, and has a wrought Iron Gate.','','','RBS Type =  2106',1,'2012-12-08 11:38:21',NULL),(27,'Maissade','HDC220','19.17464000000000','-72.14114000000000','-9.90315000000000','Popo ADELIA 3-851-6508',2,'2012-11-29 00:00:00',6,15,10,1,1,2,1,5,63,17,NULL,'Freestanding Tower w/L-Bar','Typical In-City Site fenced w/High CBS Wall. Problem with Gate, cannot open for car to go in the site.','Beam Clamps.','In the town of MAISSADE, down the street from the VOILA Tower.','','','RBS Type =  2106I',1,'2012-11-30 02:18:39',NULL),(28,'Pignon','HDN216','19.33717000000000','-72.11928000000000','-9.93914000000000','PREPTILEGE 3-787-1328',1,NULL,6,15,10,1,1,2,1,5,64,18,NULL,'Freestanding Tower w/L-BAR.','Typical In-City Site Fenced w/High CBS Walls. Site is no longer at street level as new paved road was built 3-4 feet lower than previous dirt road','Beam Clamps.','In Town of PIGNON, right next to Hopital Bienfaisance de PIGNON, not far from the VOILA Tower.',NULL,NULL,'RBS Type = 2106',1,'2012-11-30 16:58:36',NULL),(29,'Lascahobas','HDC203','18.83103000000000','-71.93286000000000','-9.97020000000000','Wilky MENELAS 3-783-8404',2,NULL,2,15,10,1,1,2,1,5,62,16,NULL,'Freestanding Tower w/L-Bar Members.','Small In-City Site with easy access. Site Guardian lives in the house/property next door to the right. Site is fully fenced with CBS walls.','Beam Clamps & pipe Grabs','Easy Access for any vehicle. Road is paved all the way to LASCAHOBAS. At the West exit of LASCAHOBAS, on the way to BELLADERES on Rue Rodolphe GARDERE, Turn Left at Rue SAINT-FRANCOIS a well maintained dirt road. Site is on the left.','','','RBS Type =  2106I',1,'2012-12-02 06:39:47',NULL),(30,'Roy Cannot','HDC318','18.90121000000000','-71.85246000000000','-10.02516000000000','Jean-Gilbert CHARLES - +509-3-600-6308',2,NULL,2,15,10,1,1,1,1,5,61,15,NULL,'L-BAR Free Standing Tower in very good condition. 150 ft tall, with last 30 ft straight. Only top 10 ft used currently by DIGICEL.','Fully fenced site sitting atop a small hill. All Equipment Cabinets, generators, ect ... really exposed to the elements. Very compact site w/little room to maneuver around.\r\nSite Guardian, Jean-Gilbert CHARLES, lives right next door.','','Beetween LASCAHOBAS & BELLADERES, turn left at Carrefour ROYSEC. Very difficult access, requires high clearance 4WD vehicule and very experienced and skillful off road driver. Many rivers/streams to cross, and lots of difficult slippery and muddy sections of the road to maneuver through.','','','RBS Type = 6102',1,'2012-12-02 06:41:39',NULL),(31,'Pilate','HDN210','19.66461000000000','-72.54856000000000','-9.76442000000000','CHER-ENFANT - 3-787-7932',1,NULL,8,15,10,NULL,1,2,1,5,75,27,NULL,'','','','','','','RBS Type = 2106\r\nSite Survey, Outdoor Enclosure and Power Install done by Team 20 on December 19th 2012.',1,'2013-01-23 16:50:45',NULL),(32,'Hinche Resoly','HDC200','19.14508000000000','-72.00750000000000','-9.97305000000000','Oliamson JEAN - +509-3-753-5391',1,NULL,2,15,10,1,1,1,1,5,54,10,NULL,'L-BAR Free Standing Tower in very good condition. 200 ft tall, with last 20 ft straight.','Located in the center of the town of HINCHES, at the corner of Rue Toussaint LOUVERTURE & Antenor FIRMIN, both paved roads. The Site Guardian, Oliamson JEAN leaves in the house next door, to the right of the gate. Site is fully fenced by a high CBS wall. Very Secure Site.','','Easy Access for any vehicule.','','','RBS Type = 2106',1,'2012-11-28 07:27:11',NULL),(33,'Bellevue / Marmalade','SDH009','19.49803000000000','-72.33556000000000','-9.84515000000000','',3,'2012-12-14 00:00:00',7,15,10,1,2,3,1,5,56,12,NULL,'','','','','','','',1,'2012-12-15 09:33:08',NULL),(34,'Domond','HDC212','18.90519000000000','-72.07175000000000','-9.90189000000000','Jean-Baptiste YLOIS 3-683-9546',2,'2012-11-10 00:00:00',2,15,10,1,1,2,1,5,52,8,NULL,'Freestanding Tower with L-BAR.','','Beam Clamps & Pipe Grabs.','On Route National #3, beetween MIREBALAIS, and PELIGRE, on the left hand side, right before the bridge over Riviere de l\'Artibonite.','','Good Hotel/Restaurant at WOZO PLAZA, beetween PELIGRE and MIREBALAIS, on the right hand side one mile before the roundabout at the entrance of MIREBALAIS.','RBS Type =  2106I',1,'2012-11-26 09:44:44',NULL),(35,'Boucan Carre','HDC230','18.92183000000000','-72.14400000000000','-9.86376000000000','Albert CINE 3-875-7318',2,'2012-11-10 00:00:00',2,15,10,1,2,3,1,5,53,9,NULL,'Freestanding Tower w/Round Bar.','','This site is round bar and requires custom side mounts.  If the sector antennas fit on the vertical legs of the tower at the top, it is approved to use these, but the bars may be too large.  3 Side mounts will be supplied.  One side mount for the rocket dish and if necessary one sidemount to hold two sectors and another sidemount to hold one','Route Nationale # 3 past MIREBALAIS. Between MIREBALAIS and PELIGRE, right after the bridge over Riviere de l\'Artibonite, turn left onto dirt road to BOUCAN CARRE. ','','','RBS Type =  2106I',1,'2012-11-26 09:51:20',NULL),(36,'Mont Carmel','HDC201','18.82533000000000','-72.10606000000000','-9.87403000000000','Inacio CELESTIN 3-783-8403 / 3-716-9986',1,'2012-12-10 00:00:00',2,15,10,1,1,2,1,5,51,7,NULL,'Freestanding Tower with L-BAR.','','','National # 3 to MIREBALAIS. At the entrance of MIREBALAIS, take entrance road to Village Mont-Carmel de la paix. Site is across the street from l\'Eglise Emmanuel Baptiste de la Saintete.','','Good Hotel Restaurant at WOZO Plaza on the road to HINCHES, about 1 mile north of the roundabout, on the left hand side. Secure Hotel with good restaurant.','RBS Type = 6102',1,'2012-12-10 06:28:43',NULL),(37,'Marmond','SDH017','19.05625000000000','-72.01706000000000','-9.95359000000000','Luc CADUCHON 3-669-4829',1,NULL,2,15,10,1,2,3,2,5,57,13,NULL,'Freestanding Tower with Round Bar Members, similar to SDH010_HILAIRE, and SDH01_OBLEON. Requires Custom Side Mounts w/ long threaded rods.','Clean Site located on Morne BAYCITE, West of Route National #3, between THOMONDE and HINCHES, in the MARMOND area. It is right next door to the VOILA BAYCITE site. Fully Fenced by high CBS Walls. Very Secure Site. Like all SDH Sites visited so far, this site has a shelter where all DIGICEL Equipment is installed.','Requires Custom Side Mounts with very long threaded rods.','Route Nationale #3 NORTH between THOMONDE and HINCHES. Turn left at MARMOND, and follow dirt road always keeping to the left until the bottom of the hill. Road up the mountain is completely destroyed and washed away. It is about a 1-2 hours hike depending on physical condition. Site Guardian has horses, donkeys and mules that are used to ferry fuel up the mountain that can be used to carry equipment and or people up the mountain. Suggest calling ahead the day before to coordinate needs and meeting time.','','','',1,'2012-11-22 06:36:45',NULL),(38,'Hilaire','SDH010','19.16614000000000','-72.36336000000000','-9.77496000000000','',1,NULL,6,15,10,1,1,1,1,5,55,11,NULL,'','','','','','','',1,NULL,NULL),(39,'Valle De Jacmel','HDS300','18.26864000000000','-72.66619000000000','-9.49320000000000','Miguel PAYEN 3-718-1441 Lives in the area.',1,NULL,7,15,10,2,2,3,1,5,66,20,NULL,'60 ft Guy Tower on the roof of a 2-Story house. Top 10 ft used by DIGICEL. Has 3 sets of 4 Guy wires which can make installation tricky. Tower face is 21 inches wide. Tower Members are 6.25 in around.','Roof Top Site. Located on the roof of the 2-Story House of Franck LEON. According to Site Guardian, he is NOT going to renew the site rental contract when it expires. He wants the tower and the DIGICEL equipment, off the roof of his house since the earthquake.','Either directly on the tower legs, or with a special mount.','Turn Right at the entrance of JACMEL, at the road to LA VALLEE. Have to cross the river. Road after river is rough dirt road that requires a 4x4 vehicule. Road is being worked on. Some rough parts have been paved. When in the city of LA VALLEE DE JACMEL, turn left immediately after the Police Station, and follow paved road until can see the site. Then take dirt road on the left. Site on the right.','','','RBS Type =  2106I',1,'2013-02-02 19:34:47',NULL),(40,'Timouillage','HDS017','18.23322000000000','-72.38272000000000','-9.62942000000000','Cyprien JONATAS 3-844-0630 leaves right next door.',1,NULL,7,15,10,1,2,3,1,5,65,19,NULL,'Freestanding tower w/Round Members, and some horizontal L-Bar Members. Might be possible to use Beam Clamps and Pipe Grabs.','Small In-City Site along the road. Fully Fenced with High CBS Walls.','Should be Custom Side Mounts. MIGHT BE possible to use Beam Clamps & Pipe Grabs.','Take Road from JACMEL to MARIGOT. After CAYES-JACMEL, right after new soccer stadium. Situated right on the side of the road.','','Hotel de l\'Amitie located right down the road is a very nice small hotem with good accomodations and a nice restaurant serving all three meals.','RBS Type = 6102',1,'2012-12-01 13:10:30',NULL),(41,'Leogane Rue Bire','HDO386','18.54132000000000','-72.58091000000000','-9.55440000000000','COLIMON - +509 5667 1540',1,'2012-10-27 00:00:00',1,15,10,1,1,1,1,5,46,2,NULL,'This site has experienced flooding in the past, and Digicel lifted the RBS/BTS cabinet onto a metal frame.  For this reason we have a non-standard tall i-mount here instead of the standard short design.  Small walled compound with barbed wire.','','This site is particularly good for mounting.  Most of the L-bars face out making it easy to attach beam clamps.','Off the north side of Rte National 2 from Port-au-Prince to Leogane.  Right turn just after the Brache bridge, and follow GPS to a small dirt track on the left.','','','RBS Type = 2116',1,NULL,NULL),(42,'Obleon','SDH011','18.43983000000000','-72.29172000000000','-9.70857000000000',' Charles Metellus: 3757 0689 / Blancha Metellus (Charles\'s Son): 3761 0127',1,'2012-10-18 00:00:00',6,15,10,1,2,3,1,5,49,5,NULL,'','','','','','','',1,NULL,NULL),(49,'World Food Program - Léogâne','WFPL','18.50937000000000','-72.61989000000000','-9.55292000000000','Karen Barsamian, WFPL 3785 7133, karen.barsamian@wfp.​org (in PauP) JeanSerge Seide, JeanSerge.Seide@wfp.org, +509 38 82 04 44 (on site in Leogane) At the front gate ask for Frederic. Also, Yves runs operations for WFP in Leogane.',1,NULL,1,23,9,NULL,NULL,NULL,1,6,45,9,NULL,'','~20m small freestanding angle-iron construction tower with outside foot pegs and diagonal 3/4\" round cross-supports (no horizontal supports anywhere on the tower). Inside equipment is in an air conditioned shipping container adjacent to the tower. Our equipment is along the back wall of the container, mostly attached to the wall via zip ties.','Nanobridge is mounted on a pole attached to one face of the tower with 2 stainless steel hose clamps. sectors are bolted directly to the L-shaped uprights.','In town. Inside the MINUSTAH Léogâne base near the WFP shelters and adjacent to a 2m satellite dish.','None','None','9 Jan 2012 UPDATE - Network equipment now plugged directly into AC of server-room UPS. (Fixed problem apparently caused by intermittent Phocos charge controller and possibly other components.)\r\n[NOW REMOVED: 110VAC with 12VDC battery backup system (15VDC power supply, 10A Phocos charge controller, (1) sealed 12V battery, and small inverter.]\r\n\r\nIn OpenNMS and on radios: WFPL-090 = leo-base-033, WFPL-270 = leo-base-240 Two 17db sectors',1,'2013-01-23 17:21:06',NULL),(51,'Bosiaux (Voila 3086)','BOSIO','18.89656891000000','-72.09365890000000','-9.88871000000000','Fedner 3697 3106 or 3443 8656',1,NULL,2,20,1,NULL,NULL,NULL,1,5,NULL,NULL,NULL,'Cabinet','','1 beam clamp for 25db Nanobridge, plus existing standoffs on top of platform','Very wet, muddy dirt road. 4x4 required.','','','- 25db link to MIBAL\r\n- 30db link to BCARE\r\n- Three 16db sectors',9,'2012-11-28 06:24:21',NULL),(52,'Boutilliers','BOUTL','18.50748000000000','-72.31686000000000','-9.69680000000000','Reggie Chauvet: tel:+509 37010044 (Digicel - preferred), tel:+509 34100044 (Voila), tel:+1 954-205-4606 (US), mailto:rchauvet@haicom.com, or Skype:papiepou',1,NULL,9,15,4,1,1,2,1,3,48,4,NULL,'The top Inveneo cabinet is Ruralnets / HRBN Network. The bottom Inveneo cabinet is HAICOM / PaP Net / NetHope Network.','Sturdy 60m freestanding triangular tower using round uprights','Rocket dishes and sectors can mount directly on these uprights.','\"Steep paved road (Laboule 12) from Route de Kenscoff at Delimart.\r\nHaicom tower is almost directly across from the scenic overlook site.\r\nLook for the blue gate on the opposite side from the overlook.\"','','','Extensive details in tower notes, see Zone 0 (tower notes) - http://10.0.2.1:8880/node/54.\r\n\r\nThere is an inverter and a UPS in the building.',1,NULL,NULL),(53,'Brache','BRACH','18.52276600000000','-72.58760100000000','-9.54998000000000','3443-8571 called on last Friday around 3 pm. 3765-0205 (not sure if this one is correct). (Eyleen, March 26, 2012)',1,NULL,1,20,1,3,1,1,1,3,16,NULL,NULL,'Enclosure','','','Site in the Leogane area (to the east of town immediately before the bridge)','','','110 VAC from shared -48v inverter',9,NULL,NULL),(54,'Morne Carmel (Mirebalais1 Voila 3013)','CARML','18.82545000000000','-72.10625000000000','-9.87155000000000','\"SonSon\" Lucener 3469 1921',1,NULL,2,20,1,NULL,NULL,NULL,1,6,17,NULL,NULL,'','','','Short steep dirt road from town, usually in decent condition. 4x4 recommended','','','',9,'2012-11-29 12:23:46',NULL),(55,'Cabrits','CBRIT','18.70804000000000','-72.17028000000000','-9.82089000000000','Larousse 3851 7638 (also arranges storage and transport of materials to the site)',1,NULL,