towers on-site. We are using the square tower.','Beam clamps to 4 poles','Very steep, rough road from Petite Riviere (1hr) - high clearance 4x4 required.','','Bring tent and lots of water to sleep on site. Le Gou-T Hotel in St Marc.','\"More details in tower notes, see Zone0 (tower notes) - http://10.0.2.1:8880/node/54.\r\n24-port AC-powered H3C switch:\r\n Port1 = vlan10 = HILRE-OBLEO\r\n Port2 = vlan11 = HILRE-270\r\n Port3 = vlan12 = HILRE-JANVI\r\n Port4 = vlan13 = HILRE-MASDE\r\n Port5 = vlan14 = HILRE-HINCH\r\n Port6 = vlan15 = HILRE-PIGNO\r\n Port7 = vlan16 = HILRE-STMRC (no cable run, may be replaced)\r\n Port8 = vlan17 = HILRE-GNAIV (no radio, no cable run)\r\n Port9 = vlan18 = HILRE-MARML (no IP configured)\r\n Port24 = vlan1 = administrative access port\r\n Port25 = trunk to Mikrotik\r\n Port26 = administrative trunk port\"',9,'2013-02-20 11:03:28',NULL),(61,'Hinche (Hinche2 Voila 3068)','HINCH','19.14325000000000','-72.01257000000000','-9.97033000000000','Mezan 3443 8694 or 3494 4100',1,NULL,2,20,1,NULL,NULL,NULL,1,5,23,NULL,NULL,'Cabinet','Standard triangular Voila tower with platform','Standoffs on platform','In town','Cyber-training center of George/Pierre in Hinche,.5 or 6 poles still at the tower location (?).','L\'Hermitage Pandiassou Hotel just outside of Hinche (call ahead)','-48 VDC (use 24 VDC converter)\r\n- 30db link to HILRE\r\n- 30db link to BAYCT\r\n- (3) 16db sectors\r\nThis is Hinche2. Contact for Hinche1 (up on the hill) is Ezai 3480 6791 or 3443 8292.',9,'2012-11-30 05:09:09',NULL),(62,'Haut Piton','HTPTN','19.85938000000000','-72.75703000000000','-9.65218000000000','',1,NULL,8,20,1,3,1,1,1,6,24,NULL,NULL,'','','','','','','',9,NULL,NULL),(63,'Jacmel (Jacmel1 Voila 3003)','JACML','18.19587643000000','-72.56950340000000','-9.54170000000000','Michelle Joseph Fosten 3110 9756/ Felippe: 33302669, Touto: 3330-2667',1,NULL,7,24,10,NULL,NULL,NULL,1,5,25,9,NULL,'','Small square tower inside a tiny enclosure with a small adjacent shelter. The tower is extremely crowded with existing antennas. Using a rope on this tower will be very challenging. May want to anchor on the far edge of the roof of the adjacent shelter.','Probably beam clamps on horizontal beams near the top of the tower on the East face. There are some partially free standoffs near the bottom of the tower, but these are probably not appropriate for our use.','In the Bellevue neighborhood past Ça Titi in Jacmel commune. About 1 hour on well maintained dirt roads from Jacmel town. Getting there requires fording the Grande Rivière de Jacmel (up to 3 fordings) and the Petite Rivière de Jacmel (1 fording), both just outside of town. If you are not sure which way to go, ask anyone which way to \"Ça Titi\". Do not attempt crossing during or immediately after rain. 4x4 required. if you should asked for directions , ask people for la montagne, St Joseph digicel\'s site cause there are many digicel\'s sites in this area.','Minimal storage in crowded shelter','Hotels in Jacmel town. Book 2 weeks ahead for weekend days.','-48VDC and 110VAC currently available. Need to check if the 110VAC is on the main battery stack.',1,'2013-02-20 11:02:42',NULL),(64,'Janvier','JANVI','18.96598000000000','-72.36761000000000','-9.74899000000000','Rosemonde 3632 9562',1,NULL,2,20,1,NULL,NULL,NULL,1,5,26,NULL,NULL,'Building','','','Rosemonde can be found the second left after the bridge if coming from the tower turnoff.','','','',9,'2012-12-17 19:01:40',NULL),(98,'Lascahobas (Voila 1078)','LASCB','18.83600000000000','-71.93621000000000','-9.96848000000000','Evanel Isalem 3924 1843, 3699 6881, 3755 2791',1,NULL,10,20,1,NULL,NULL,NULL,1,5,27,NULL,NULL,'','Standard triangular Voila tower','Several existing standoffs','Steep, dirt and rock path. High clearance 4x4 required.','','Not available','',9,'2012-11-30 16:57:05',NULL),(99,'La Vallée de Jacmel (Voila 3057)','LAVLE','18.26894900000000','-72.66705500000000','-9.49719000000000','',1,NULL,7,20,10,1,1,2,1,5,66,NULL,NULL,'','','','Undated note: did not visit as river was too high to cross at the time','','','HRBN had to decommission this site at the request of Digicel during the migration....but then were requested to \"recommission\" it on 27 Feb 2013 when Digicel decommissioned HDS300.\r\n\r\nAttached the original survey and workorder from the first installation at LAVLE, which may be helpful when reinstalling it.',1,'2013-03-01 12:53:56',NULL),(100,'Léogâne','LEOGN','18.51003056000000','-72.63198889000000',NULL,'Site contact: Wesley 3769 7334 Power technician: Dukens 3636 3761',1,NULL,1,15,6,NULL,NULL,NULL,NULL,6,29,9,NULL,'','','','','','','',1,NULL,NULL),(101,'Bernard (Voila 3063)','BERNA','18.35269000000000','-72.58593000000000','-9.53005000000000','Denais 3443 8505',1,NULL,7,20,1,NULL,NULL,NULL,1,5,14,NULL,NULL,'Enclosure: combination lock 6-22-10','Standard triangular Voila tower with angle-iron construction and platform at top. The outer wall fell down in the earthquake and has no been replaced. The neighbors say that thieves are constantly visiting the site at night to attempt to steal things (diesel fuel perhaps?).','Lots of free standoffs on platform at top','Very short steep unpaved road off highway to Jacmel (towers clearly visible from the road). 4x4 recommended.','None','None','',9,'2012-11-27 12:13:11',NULL),(120,'L\'Estere (Voila 3045)','LESTR','19.29971000000000','-72.61129000000000','-9.65998000000000','Jean-Baptiste 3473 3279',1,NULL,6,20,1,NULL,NULL,NULL,1,5,30,NULL,NULL,'','Very wide, tall, square tower with a platform. Like LESTR but much shorter.','Beam clamps in corners at platform height','In town','','','- 30db dish to HILRE\r\n- 25db dish to DESAL\r\n- Three sectors',9,'2012-12-12 09:38:55',NULL),(121,'Liancourt (Voila 3092)','LIANC','19.12685000000000','-72.54398000000000','-9.67326000000000','Alfred 3443 8423. Alfred actually follows the rules, so call the Voila NOC in advance for authorization.',1,NULL,6,20,1,NULL,NULL,NULL,1,5,31,NULL,NULL,'','Nice large standard triangular tower with platform','Standoffs on platform','In town immediately on the main road','','','- use 24 VDC converter\r\n- 30db dish to HILRE\r\n- Three 16db sectors\"',9,'2012-12-17 18:33:53',NULL),(122,'Limbé 2','LIMB2','19.70446000000000','-72.40377000000000','-9.82638000000000','',1,NULL,8,20,1,3,1,1,1,6,32,NULL,NULL,'Enclosure','','','','','','',9,NULL,NULL),(123,'Limbé (Limbé1 Voila 3016)','LIMBE','19.69095000000000','-72.33678000000000','-9.88671000000000','',1,NULL,8,20,1,NULL,NULL,NULL,1,6,33,NULL,NULL,'','','','','','','',9,'2013-01-23 13:34:34',NULL),(124,'Marigot','MARIG','18.23565000000000','-72.30933000000000','-9.66036000000000','Fredo at 3443 8565.  Can also try Cristanne at 3443 8424 (not reached).',1,NULL,7,20,1,3,1,1,1,5,34,NULL,NULL,'','Standard triangular Voila tower of angle-irons with a top platform with standoffs','Free standoffs on platform','Short, steep, slightly overgrown road that leaves the main road at 18.23354,-72.31386. 4x4 required.','None','Possibly hotels in Marigot. Recommended hotel in Ti Mouillage is Hotel Kabic (3780 6850 - good Internet!). On weekends you may be stuck at the less comfortable but still clean Hotel l\'Amité (3888 9386).','',9,NULL,NULL),(125,'Marmelade (Voila 3153)','MARML','19.49755000000000','-72.33580000000000','-9.84797000000000','Molijen Jula 3427 7773',3,NULL,8,20,1,NULL,NULL,NULL,1,6,35,NULL,NULL,'','','','The site is approximately 600m from the town of Marmelade. From the welcome statue, veer right up the steep road at 19.517253,-72.362393. You will pass first the Access Haiti tower, then the Digicel tower, then finally you will come to the Voila towers—a small triangular tower like Janvier, and a medium sized square tower, like Hilaire. The site has perhaps the best view of any site in Haiti. You can see Cap Haïtien from the roof of the shelter, the central plateau, and even as far as Obleon.','','','',9,'2012-12-30 06:39:02',NULL),(126,'Maïssade (Voila 3067)','MASDE','19.17420618000000','-72.13999923000000','-9.90631000000000','',1,NULL,2,20,1,NULL,NULL,NULL,1,5,NULL,NULL,NULL,'','Standard triangular Voila tower with platform','Round standoffs on top platform','In town center','Save the Children','Save the Children guest house (5 minute drive)','- 30db link to HILRE\r\n- Two 17db sectors',9,'2012-12-12 09:37:01',NULL),(127,'Mirebalais (Mirebalais2 Voila 3080)','MIBAL','18.83373323000000','-72.10544377000000','-9.87299000000000','\"SonSon\" Lucener 3469 1921',1,NULL,2,20,1,NULL,NULL,NULL,1,3,36,NULL,NULL,'Cabinet','','Beam clamps on 3 sides, using one existing standoff at very top of tower for 2 sectors','In town center','Limited storage at WorldVision office in Mirebalais','Mirage Hotel in main town square (convenient) or Wozo Hotel on the road toward Hinche (nice)','16-port H3C AC-powered switch installed\r\n - port 1 (vlan 11) MIBAL-CARML\r\n - port 2 (vlan 12) MIBAL-BOSIO\r\n - port 3 (vlan 13) MIBAL-SODO\r\n - port 4 (vlan 14) MIBAL-050\r\n - port 5 (vlan 14) MIBAL-170\r\n - port 6 (vlan 14) MIBAL-290\r\n - port 18 - trunk to Mikrotik\r\nStatus:\r\n- links to CARML (22db), BOSIO (25db), SODO (30db)\r\n- Three 16db sectors',9,'2012-11-28 10:13:01',NULL),(128,'Obleon (Voila 1004)','OBLEO','18.43875000000000','-72.29069000000000','-9.70644000000000','Enoch 3441 0218',1,'2012-10-18 00:00:00',9,18,1,1,1,1,1,3,NULL,9,NULL,'','2 towers on site, one triangular tower with 2-3\" rounds and one new octagonal tower. We are using the old, flimsy triangular tower. There are foot pegs on the outside on one side of the tower.','Direct mounting on the tower rounds. Could use custom standoffs or U-bolts, but the tower is not compatible with beam clamps.','Steep paved road, 1 hour from Petionville. Take the road toward Furcy past Kenscoff and turn right at the first paved road after the Petit Freres et Soeurs sign (on the left). Follow this road until you reach the towers.','On site storage room next to main equipment room','','110VAC via -48v inverter for our use\r\n16-port AC-powered switch installed\r\nport1 - OBLEO-BOUTL\r\nport2 - OBLEO-HILRE \r\nport3 - OBLEO-JACML\r\nport4 - OBLEO-BELVU\r\nport5 - OBLEO-CBRIT',1,NULL,NULL),(129,'Pignon (Voila 3088)','PIGNO','19.33504552000000','-72.11776798000000','-9.94223000000000','',1,NULL,2,20,1,NULL,NULL,NULL,1,5,NULL,NULL,NULL,'','Standard triangular Voila tower with platform','Round standoffs on top platform','In town center','Haiti Outreach','Haiti Outreach guest house','-48 VDC in cabinet (use 24 VDC/VDC converter)\r\n- 30db link to HILRE\r\n- Three 16db sectors',9,'2012-12-12 09:33:57',NULL),(130,'Pilate','PILAT','19.66710000000000','-72.55308000000000','-9.73715000000000','Junior 3443 8896',1,NULL,8,20,1,3,1,1,1,6,37,NULL,NULL,'','','','The town of Pilate is accessible via a bumpy mud and rock road, 45 minutes from Gros Morne, and 1 hour from Plaissance. The site is in the main paved square of Pilate. The tower is a large triangular tower with upper platform. The grounding plate at the base of the tower is quite high off the ground, but otherwise the site is straightforward. The guard lives diagonally across the main square from the tower in the house with the large red gate.','','','',9,NULL,NULL),(161,'Petite Rivière de l\'Artibonite (Voila 3055)','PRIVA','19.12251000000000','-72.48166000000000','-9.70778000000000','Ask Jeffrey Carré (Transversal) for contact info.',1,NULL,6,20,1,NULL,NULL,NULL,1,5,38,NULL,NULL,'','Wide but short square tower with a platform. Like LESTR but much shorter.','Beam clamps in corners at platform height','In town','','','',9,'2012-12-17 19:01:00',NULL),(162,'Pont Sondé (Voila 3071)','PSOND','19.14786000000000','-72.61349000000000','-9.63521000000000','Eval 3443 8323',1,NULL,6,20,1,NULL,NULL,NULL,1,5,39,NULL,NULL,'','Standard triangular Voila tower with platform','Standoffs on platform','In town near the soccer field','','','-48 VDC (use 24 VDC converter)\r\nEquipment:\r\n- 30db dish to HILRE\r\n - Three 16db sectors\r\nOther:\r\nother:\r\n - 1.5\"\" EMT bars stored on site\r\n - Watch out for the killer bees.',9,'2012-12-08 20:28:07',NULL),(163,'Saut d\'Eau (Voila 3091)','SODO','18.82249378000000','-72.21422652000000','-9.83393000000000','Jiva 348497687-36986998 / Ask for TIVA not Jiva Guardian nickname ',1,NULL,2,15,10,1,1,NULL,1,5,40,NULL,NULL,'','Standard triangular Voila tower with platform','Existing standoffs','Take the well-maintained gravel road from town towards the waterfalls and turn right once you are at the same height as the tower.\r\n\r\nEaquipment is in voila cabinet . Please make sure that somebody can have the key before leaving .','','Have not tried the $25/night hotel across from the police station.','-48 VDC (use 24 VDC converter)\r\n- 30db link to MIBAL\r\n- Two sectors',1,'2013-02-20 11:02:56',NULL),(164,'Saint Marc (St Marc xp)','STMRC','19.08776000000000','-72.70772000000000','-9.56291000000000','',1,NULL,6,20,1,3,1,1,1,3,41,NULL,NULL,'','Not a tower, but the roof of a Voila shelter that had a tower on it. Excellent 270 degree view of Saint Marc bay.','Tripod mounted on roof with a 5\' bar','Just above town. access from just north of La Colline hotel.','On-site storage','Le Gou-T hotel on the north end of town','110VAC via dedicated -48v inverter\r\n- put in a full 10\' bar to raise the antennas higher.\r\n- 30db dish to HILRE-270\r\n- One 17db sector',9,NULL,NULL),(165,'Verrettes (Voila 3043)','VERET','19.05240000000000','-72.46626000000000','-9.70422000000000','David 3737 8608',1,NULL,6,20,1,NULL,NULL,NULL,1,5,42,NULL,NULL,'','Very short square tower with a large tree growing into the tower on the west side','Beam clamps at the top of the tower','In town','','','-48 VDC (use 24 VDC converter)\r\n- Poor signal\r\n- 30db dish to HILRE\r\n- Three 16db sectors',9,'2012-12-08 11:35:10',NULL),(166,'Verjon (Voila 3066)','VERJN','18.26347976000000','-72.43249369000000','-9.62346000000000','',1,NULL,7,20,1,NULL,NULL,NULL,1,6,43,NULL,NULL,'','','','\"From the main east-west road, turn north on Route des Orangiers (immediately west of the airport), turn right at the \"\"T\"\", then fork right at the Station des Orangiers (18.2558,-72.508126). It is then about 11km to the turn off. The first part of the road after the fork is partially paved and generally a good road, but extremely steep. The last part of the road is a short overgrown dirt track which becomes very steep for the last 200m.\r\nSee: http://www.openstreetmap.org/?lat=18.2557&lon=-72.4765&zoom=14&layers=M\r\nPossible (unverified) option 2 is to turn north at 18.2558,-72.508126 at Ravine Meyer.\r\n4x4 required (with working low-4). Do not try to go via Cayes Jacmel. Even though marked as a proper road on some maps, this road becomes a shoulder-width footpath several km from the tower.\"','','','',9,'2013-01-23 13:35:52',NULL),(167,'Vertières (Voila 3007)','VERTI','19.72233000000000','-72.22208000000000','-9.95512000000000','',1,NULL,8,20,1,NULL,NULL,NULL,1,6,44,NULL,NULL,'','','','','','','',9,'2013-01-23 13:34:52',NULL),(169,'Foo','FOO','19.85948000000000','-72.75713000000000','-9.65355000000000','',3,NULL,1,18,1,1,1,1,1,5,NULL,1,NULL,'','','','','','','',2,NULL,NULL),(174,'Gulu University Tower','GULU','2.78963900000000','32.31679900000000','1.74612000000000','Jeffrey - Dean of Science 256 772 855 057',NULL,NULL,9,27,14,6,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'About 10 minutes outside of downtown. The campus is mostly single storied with 1 2-story building at the entry. It sits on the top of a hill that falls away to the west. The tallest structure on campus is a 2-story building. There is a 25 meter high tower that was built by Orwello George. He is a lab technician. It\'s fairly sturdy, but needs some improvements. In the center of campus is a huge mango tree about 40 years old. It is an obstacle for our purposes. Gulu U has UTL service. It comes in along above-ground cable. Power at the campus is intermittent.',4,'2013-01-28 17:26:30',NULL),(180,'Bobi','BOBI','2.55252000000000','32.35805000000000','1.70432000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Bobi is just off Kampala Road, about 30km\'s from Gulu to the south. It is easily accessible and the site is located at the Sub County offices. The land is flat and within the vicinity there are few buildings or trees over one storey tall. To the east at 90 dgr\'s there is a 12 metre tall tree and to the south 3m vegetatian. At 300-320 dgr\'s we have two telecom masts roughly 200m away.',4,'2013-01-17 09:40:39',NULL),(181,'Keyo','KEYO','2.81513400000000','32.18605200000000','1.75093000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The site is around 13 Km from Gulu town access to the site is a dirt road the place is near the road the  overall terrain of the surrounding is a an open field with 10-15 meter tall trees  there are  building nearby with 5meter tall and 15meter wide there is also a telecom tower 2 kilometers from the main point at 138 degree  there is no grid power source and the security of the place is not that great its not in fence  ',4,'2013-01-16 17:13:38',NULL),(182,'Koro','KORO','2.72516300000000','32.35866800000000','1.73051000000000','Peter Okumu 256-77733-8838',NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Easy drive from Gulu-heading south from gulu look for signs on left for school (gps poin for this curve)-follow road and make another left with a sign then a right when you see the buildings. 5 new Buidings(1 story) around the existing standing container (20foot that is fully installed and operational) / Overall flat area with no signifcant high points or buildings. All fenced in campus with container being actively used. Not too many people walking around the grounds. They also had existing satellite internet/dish installed. Visibility to surrounding areas: Gulu-good, Lakwana-needs height, Unyama-trees in the way.Nice video of site too!',4,'2013-01-10 18:28:28',NULL),(183,'Unyama Sub County Office','UNYAM','2.83813500000000','32.37917300000000','1.75244000000000','Kinyera Patrick 256-782-467376',NULL,NULL,9,36,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Off the main road. The approach drive is somewhat overgrown, but passable. Large fairly flat grassy area with sparse trees. No real views. Buildings consist of a new health center and a maternity ward.  They are well constructed with tin roofs. Currently they are vacant. \r\n\r\n***REJECTED 1/28/2013, per field team the Unyama teacher\'s college will replace this site.***',4,'2013-01-30 14:46:53',NULL),(184,'Patiko','PATIK','3.01483100000000','32.32353400000000','1.78223000000000','Kitara 782177445',NULL,NULL,9,29,14,6,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'General site is relatively flat. Brick structure with iron roof. It is the highest structure on the site. There are a number of big trees in the area that will be obstructions. Patiko rock approximately 2 km away is a high point and obstruction. From here to Awach , 120 deg, some trees and not so bad. To Palaro 30 deg and some trees in the way. Pawel 300 deg. looks obstructed by the rock. District health center has a water tower approximately 7 meters high. Came from Awach, took about 30 minutes. there are some coordinates. from gulu it\'s about 50 minutes\r\n\r\n***1/28/2013 Add\'l photos added showing compound perimeter***\r\n\r\n\r\n*2/1/2013*marked as rejected because this particular site cannot see Zaipi.  Will have to connect through a tower 100m away.',4,'2013-02-01 14:10:27',NULL),(185,'Palaro','PALAR','3.11411300000000','32.36578600000000','1.79138000000000','Ngole David - Local Council Chairman LC3 -- 0773470705, 0712138078',NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Good dirt road.The site is at the sub-county headquarters.The police building is about 50 meters slightly downhill. Site on a knoll. Overall flat with approximately 300 meter peak in the distance. There is an approx. 4-5\" diameter 10M mast on the police building. In the distance there is a big ass tower and mountain. The building is concrete block with iron sheet roofing. Fairly new construction. There are some big trees. From Palaro to Patiko there are big trees in the way. Clean to Pawel. To Awach barely clears big trees. Be aware of unexploded ordinance.',4,'2013-01-10 18:29:13',NULL),(186,'Pabbo','PABBO','3.00116000000000','32.14270000000000','1.78383000000000',NULL,NULL,NULL,9,27,14,9,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'The two opposite buildings have corrugated iron roofs, while the taller main building is tiled. It is a 40 minute drive from Gulu, but could be longer in worse weather. There are no major turns in the road, just the main road to Atiak, and a left as you enter Pabbo. There are easterly views of up to 20kms in my estimation but generally low terrain on all sides in the immediate vicinity. No obvious lack of sight issues, there are trees 1km off towards the telecom masts, but they constitute a very small obstacle within the 360 view. Big passing population and chicken wire fencing for security. ',4,'2013-01-28 17:25:10',NULL),(187,'Atiak','ATIAK','3.25721000000000','32.12105000000000','1.81928000000000','Acaye Jhon Bosco-- +256712045683',NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'the site is around 60Km from Gulu town Access to the site is a dirt road the place is by the road there are four telecom tower masts surrounding the place one of them is an orange tower mast around 80 meter form the main point at 50 degree with a GPS point of  N:03.257689° E: 032.121621° and a UTL tower mast 500m south, Airtel tower mast 1Km north and an MTN tower mast 1.5 Km at 130° the overall Terrain of the place is flat and mountain’s from a distance with lots trees the buildings in the compound are  5meter and there with is 20meter wide there is no grid power we might use a solar the security of the place is safe since its in a compound ',4,'2013-01-10 18:26:41',NULL),(188,'Pakelle','PAKEL','3.35419200000000','31.85594200000000','1.83868000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Good road coming in through a bustling town. Lots of people at the sub-county offices. Site is slightly sloping with lots and lots of trees surrounding it. In the distance, approx 2 km there is a tower visible. This seems to be the only opportunity, unless a tower goes up here. The offices are well built block with stucco and a tin roof. There are a couple of small solar panels on the roof. The only high points are those mentioned - the offices and the distant tower. Trees are a big issue.',4,'2013-01-10 18:29:06',NULL),(189,'Zaipi','ZAIPI','3.39207200000000','31.95521100000000','1.84693000000000','Adema 779160598',NULL,NULL,9,27,14,6,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Road is good coming in from Arinyapi. Compound is loosely fenced in. Behind the sub-county office building, they are housing Sudanese refugees. Very flat area with lots of trees - including trees planted as a crop. Health center across the road and police located to one side. There is an approximately 10m high water tower on the police property. On site the sub county offices are concrete block with plaster and a tin roof and the power is questionable. The condition of the building is just okay. There are no good visual connections to any of the other sites, although there is some possibliity of a connection to Atiak. Perhaps a large tower could provide line-of-site opportunities. To the SE the view opens up and you can see for miles. There is a 7 m mast on the property, 3\" wide with lots of obstacles.',4,'2013-01-28 17:25:46',NULL),(190,'Koc Goma Primary School','KOGOM','2.59926000000000','32.17747000000000','1.72030000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-31 17:46:38',NULL),(191,'Moyo Bishop Asili Secondary School','MOYO','3.64327000000000','31.72963000000000','1.88380000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-15 15:54:24',NULL),(192,'Dufile Health Center','DUFIL','3.56890000000000','31.92481000000000','1.87417000000000',NULL,NULL,NULL,9,29,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-31 17:34:02',NULL),(193,'Greenfield 4 (original survey)','GF4','3.63460000000000','31.80917000000000','1.88491000000000',NULL,NULL,NULL,9,27,14,6,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'***PLEASE NOTE*** 1/29/2013, I moved the GPS coordinates for this site back to the January survey coordinates because of the obstruction issue with the link to Metu.  For reference, the coordinates collected by Ken and Jonathan at the (obstructed) top of the ridge to the north are (3.63670 31.80951)',4,'2013-01-29 17:46:25',NULL),(194,'Haut Limbe','HDN202','19.70616700000000','-72.35341900000000','-9.87950000000000','PHITO - 3-757-3110',1,NULL,8,15,10,1,2,3,1,5,76,29,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Site Survey, Outdoor Enclosure and Power Install done by Team 20 on December 19th 2012.',1,'2013-01-22 17:21:22',NULL),(195,'Acul-du-Nord','HDN222','19.68041700000000','-72.31886100000000','-9.89492000000000','MONCIUS - 3-787-7784',1,NULL,8,15,10,1,NULL,NULL,1,5,77,30,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Site Survey and Power Install done by Team 20 on December 19th 2012.\r\nOutdoor Enclosure not installed, Will have to be installed during Site Installation.',1,'2013-01-22 17:21:41',NULL),(196,'Plaine-du-Nord????','HDN221','19.67636100000000','-72.26836100000000','-9.90752000000000',NULL,1,NULL,8,25,10,1,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,'2012-12-07 15:42:14',NULL),(198,'metu health center ','METU','3.66772000000000','31.78895000000000','1.88544000000000','Ippie Francise +256755428755',NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,'The place 50Km meter from Adjumani town access to the site is a dirt road the place is near by the road the overall Terrain of the surrounding is an open field there is a mountain 6-8 Km from the site there are 6meter tall and 7meter wide buildings trees that are 6-8 meter tall there is also a police tower mast at 100 degree from the point on N:03.66757° E:031.78957° there is no grid power source and the security of the place is ok since there is a police tower with a 100meter range  ',NULL,NULL,NULL,NULL,NULL,4,'2013-01-10 18:28:38',NULL),(199,'Umi health center','UMI','3.52265100000000','31.80221100000000','1.86567000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,'The site is 30Km from Adjumani town Access to the site is a dirt road the place is by the road the overall terrain of the surrounding is an open field with a couple of trees with 8-10meter tall there is a 5meter tall with 6meter wide building that has 10 meter metal pole attached  to it there is no grid power and the security is not that great its not in fence ',NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-16 17:38:12',NULL),(200,'Arinyapi Health Center','ARNPI','3.47152000000000','32.00806000000000','1.85353000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,'Good road from Zaipi. Coordinate taken on the turnoff from the road. On a high plateau with sparse trees. Large mango on the site about 10 m high, but wide. Location is a fenced in health center comprised of 3 primary buildings. All are concrete block with plaster and tin roofs. Nice paint job too! There is an existing 10m high, 6\"diameter mast at GPS2 (. Small 1\' x 1\' solar panel on the mast. Viewing towards Atiak: bad from gps1, good from gps 2. Same for Zaipi. There are distant towers. One large one is at 290 deg about 3 km away. (Sam loves that tower). Multiple towers at 90 deg about 15k. Locals say they are at Bibia.GPS 1 is ma',NULL,NULL,NULL,NULL,NULL,4,'2013-01-10 18:26:31',NULL),(201,'Jurumini','JURMI','3.39207000000000','31.95521000000000','1.84387000000000',NULL,NULL,NULL,9,29,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-15 16:08:53',NULL),(202,'Parabongo','PARAB','2.90649000000000','32.15276000000000','1.76585000000000',NULL,NULL,NULL,9,29,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-15 16:12:47',NULL),(203,'Lakwana','LAKWA','2.63194900000000','32.41948700000000','1.71845000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-31 17:45:55',NULL),(204,'Awach','AWACH','2.96317000000000','32.40793000000000','1.77083000000000',NULL,NULL,NULL,9,27,14,5,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-01-28 17:26:48',NULL),(205,'Pachara','PACHA','3.39106700000000','31.78960200000000','1.85338000000000',NULL,NULL,NULL,9,29,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2013-02-14 10:23:27',NULL),(206,'Warfield Building','WARF','37.78276099951862','-122.41003799992330','14.00455000000000','Contact Mike McCarthy for access 415-581-3943',1,NULL,9,43,15,10,2,NULL,2,3,NULL,34,NULL,NULL,'This is a rooftop site on top of the ~8 story Warfield Building on Market Street.\r\n\r\nAccess is currently through the construction site on the first floor.\r\n\r\nTake the elevator to the top, and climb the set of stairs opposite the elevator exit to an unlocked door to the attic / maintenance space.  Indoor equipment is around the right side of the elevator shaft. and is wall mounted to a sheet of plywood.  City of SF plans to clean up this site.  The SF Wifi network has access to community fiber at this location via a switchport (administered by Tim Pozar).  WARF mikrotik is plugged into a switchport on the San Francisco CBN switch.\r\n\r\nOutdoor equipment is up a steep ladder / staircase to the roof.\r\n\r\nAC Power for tools is available from an outlet in the elevator winch room.\r\n\r\nThis site is one of the primary internet connections for the Inveneo Office, please coordinate maintenance with noc@inveneo.org.\r\n\r\n',NULL,NULL,NULL,NULL,NULL,3,'2013-03-06 09:25:07','0.00'),(207,'Bruce House','BRUCE','37.88951000000000','-122.25270000000000','14.00509000000000','Bruce Baikie - bruce@inveneo.org - +1-415-518-9590',1,NULL,9,45,11,NULL,NULL,NULL,1,6,NULL,NULL,NULL,'This is Inveneo employee Bruce Baikie\'s house.  Site is currently down due to issues at both BRU as well as issues with remote radios.\r\n\r\n',NULL,'A pole is mounted on the chimney with two rocket dishes:  BRU-TPX and BRU-SBO.','Contact Bruce.',NULL,NULL,NULL,3,'2013-02-20 13:02:21',NULL),(208,'Alexander Hotel','ALX','37.78436499944524','-122.41149600204130','14.00515000000000','Mike McCarthy,  +1 415 845 3214.  Also, believe front desk has a roof key.',1,NULL,9,43,15,10,2,NULL,2,3,NULL,NULL,NULL,NULL,'This site is on the roof of the ~12 Story Alexander Residence building.  This is low income / community housing.  Access coordinated by Mike McCarthy.\r\n\r\nPlease note: there was one incident during install where a few tools went missing that were left in the 12th floor hallway while someone went to the roof.  Keep a close eye on your tools.\r\n\r\nOutdoor equipment is on a pole on the roof of the elevator shaft.  Ladder is necessary.\r\n\r\nIndoor equipment is in the riser closet on the top floor.',NULL,'Check in with front desk.  Take elevator to top floor.  Access coordinated by Mike McCarthy.\r\n\r\nIndoor equipment is in riser closet just to right of elevator exit.\r\n\r\nStairs lead to roof, and from there a ladder is required to reach the top of the elevator shaft.  Be sure to bring one.',NULL,NULL,NULL,3,'2013-03-06 09:25:07','0.00'),(209,'San Bruno Mountain','SBO','37.67805000000000','-122.40130000000000','13.97912000000000','Tim Pozar - +14156653790  Is a member of the \"equipment shack co-op\" and coordinates access',1,NULL,9,43,15,11,1,2,2,3,NULL,NULL,NULL,'There is a small basic shack that is maintained by a co-op of members who colocate on the tower.  There have been some weatherproofing issues in the past.  These seem to be resolved, but not sure.','This is a tall, L-Bar style American Tower site on the top of San Bruno mountain.  There are many other towers here which may interfere with LoS depending on the direction of your wifi link.  Also, there are some high power transmitters (FM, TV) that may interfere.\r\n\r\nInveneo equipment is only about 8m up the tower near the base on a pole mounted near the middle of the north face of the tower.  One pole with two RocketDishes.\r\n\r\nIndoor equipment is in the shack on a rack shelf.  The SF Wifi network has access to community fiber at this location via a switchport (administered by Tim Pozar).\r\n\r\nThere is an open wifi AP in the shack that will get you on the internet. ','Beam clamps onto L-Bar tower','There are two simple combination padlocks on gates...one on the fence around the tower and building, and one just around the tower.  The combination for both is 1-2-2-0.\r\n\r\nDirections from Inveneo SF are here: http://maps.google.com/maps?f=d&source=s_d&saddr=972+Mission+St.+San+Francisco+CA&daddr=37.686885,-122.435052&hl=en&geocode=;FWUOPwIdFMqz-A&mra=ls&sll=37.687745,-122.435251&sspn=0.006911,0.012177&ie=UTF8&ll=37.735698,-122.413101&spn=0.110506,0.194836&t=h&z=13\r\n\r\nBasically take Guadalupe Canyon Parkway to the San Bruno Mountain Public Area trailhead.  Turn right off of Guadalupe Canyon Parkway into the parking lot, loop around to the right, and cross under the parkway via a tunnel.  Drive to the top of the mountain, use GPS to find the right tower.\r\n\r\nThe road has some signs about limited access, but we have never had problems driving all the way to the top in the past.',NULL,NULL,NULL,3,'2013-03-06 09:25:07','0.00'),(210,'InveneoSF','INV','37.78171000000000','-122.40840000000000','14.00236000000000','Basil Ayoub, basil.ayoub@califashions.com, 415.546.1111',1,NULL,9,43,12,10,2,NULL,2,3,NULL,33,NULL,NULL,NULL,'Unistrut mount to concrete wall with pipe grabs\r\n\r\nThere is a gooseneck weatherhead for watertight cable entry into the building riser closet.  Cables fed through here enter Inveneo\'s 5th floor riser closet where Inveneo Indoor equipment is located.','CBN / Outside Organizations should contact Ian Knox, ian@inveneo.org, +1.415.901.1969\r\n\r\nINVENEO ONLY:  Contact the building owner / landlord Basil Ayoub: basil.ayoub@califashions.com',NULL,NULL,'Inveneo\'s San Francisco office is located on the 5th floor of this building.  Inveneo rents the space and coordinates WiFi spectrum and roof installation through the landlord.\r\n\r\nAll outdoor equipment is mounted on the roof on the top of the elevator shaft.  There is a fair amount of Wifi Equipment at this site so plan frequency usage carefully.  \r\n\r\nThere is a gooseneck weatherhead for watertight cable entry into the building riser closet.  Cables fed through here enter Inveneo\'s 5th floor riser closet where Inveneo Indoor equipment is located. \r\n\r\nLocal WISPs MonkeyBrains has a customer connection that serves both Inveneo and the 3rd floor tenant, AdRoll installed here.  MonkeyBrains operates two Ubiquiti radios on the roof to maintain redundancy:  one RocketM5 / RocketDish 30 and one NanoBridge.\r\n\r\nLocal WISP WebPass has a single 5.8GHz panel antenna here on a non-penetrating roofmount.  This is the CPE for the 2nd floor tenant Method. ',3,'2013-03-06 09:25:07','0.00'),(211,'WARF','WARF','37.78276099951862','-122.41003799992330','14.01414000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:28:55',NULL),(212,'BruceHouse','BRU','37.88951000000000','-122.25270000000000','14.01474000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:27:59',NULL),(213,'Twin Peaks','TPX','37.75448599999998','-122.44665600000000','14.01314000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:28:37',NULL),(214,'203 Eddy (Alexander Hotel)','ALX','37.78436500000000','-122.41149600000000','14.01474000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:29:46',NULL),(215,'SanBrunoMountain','SBO','37.67805000000000','-122.40130000000000','13.98866000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:28:26',NULL),(216,'InveneoSF','INV','37.78171000000000','-122.40840000000000','14.01365000000000',NULL,1,NULL,9,24,NULL,NULL,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,8,'2013-01-17 18:27:46',NULL),(217,'Twin Peaks','TPX','37.75448600000000','-122.44665600000000','14.00357000000000','Mike Hauck - mike.hauck@sfgov.org - (office): 415-285-1486 (cell): 415-609-9584 is the site admin',1,NULL,9,45,15,11,1,2,2,3,NULL,NULL,NULL,'this is one of two very similar medium size towers on top of twin peaks.  Inveneo equipment is on the southernmost tower.','Outdoor equipment is mounted on one pole mounted to the tower with beam clamps on the tower\'s east face.\r\n\r\nThe pole holds three pieces of inveneo equipment:  INV-ALX (RocketM5 + RocketDish 30),   INV-AND (a non reachable NanoStation M5 that used to link to Andris\' house) and INV-BRU (RocketM5 + RocketDish 30).  INV-BRU is daisy chained off of the second LAN port on the NanoStation M5.\r\n\r\nIndoor equipment is in a large city of San Francisco equipment room with many racks.  City\'s handheld radio network is hosted here.\r\n\r\nThe SF Wifi network has access to community fiber at this location via a switchport (administered by Tim Pozar).\r\n\r\nInveneo indoor equipment is an Inveneo R4 server (TPX) and PoE injectors for the two radios.  Inveneo equipment is all plugged into a switch and remote manageable power supply administered by Tim Pozar (contact info above).  He can power cycle ports or power outlets on request.',NULL,'Visits must be coordinated through Mike McCarthy who usually has to be on site during work performed.\r\n\r\nTower is just adjacent to the tourist lookout at twin peaks.  There is a small walled compound just as you make the last turn into the tourist area.  If you call the site contact (and he knows you\'re coming) he\'ll open the gate.  Parking is limited inside the walled compound, but there is ample parking in the tourist viewpoint.',NULL,NULL,NULL,3,'2013-03-06 09:25:07','0.00'),(218,'Cwero Health Center','CWERO','2.92270900000000','32.51444600000000','1.76183000000000','Bonix Ojambo - 782990151',NULL,NULL,9,27,14,4,NULL,NULL,2,2,NULL,NULL,NULL,NULL,NULL,NULL,'Dirt road',NULL,NULL,'Line of sight is limited on all sides at ground level due to dense vegatation, mainly trees. No power at all, would rely on solar for the mast. Security is solid, ascaris at night. Open for solar due to arc of the sun and tree location not a solar issue. A number of buildings on site with the main GPS taken + a secondary location as a backup, across the road, titled \'cwero site 2\'. Tallest buildings are 6m, a watertower with wrap-around buldings totalling 5m tall. GPS 2 -   2.922512°  32.513872°\r\n\r\n***NOTE ADDL COORDINATE FOR WATER TOWER***',4,'2013-01-31 17:46:19',NULL),(219,'Koro Sub County Office','KORO2','2.73540900000000','32.30735900000000','1.73846000000000','NONE GIVEN',NULL,NULL,9,29,14,4,NULL,NULL,1,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Two GPS\' were taken at Koro as the LoS issues make the site seemingly difficult. Gulu\'s mast is 6.14k\'s away while Koro school offers a chance at LoS as it\'s 5.83k\'s away on 100dgr bearing. While the vicinity is open, there is vegetation on all sides, with a view to Gulu obscured by 20m trees. Gulu highway is to the immediate west but even across the road there is no LoS to be found at ground level. Power lines run down the middle of the compound. There is a gap to Koro with pic attached while there is potentially a corridor to Gulu SS at 9dgr. Solar would be fine as a backup, no overhanging issues there. Koro prelim 2 -   2.735049°  32.307476°\r\n\r\n**NOTE TWO GPS COORDS WERE TAKEN ON COMPOUND.  KMLs for both in files saved below.',4,'2013-01-31 17:33:41',NULL),(221,'Paicho Sub-County Office','PAICH','2.89754000000000','32.45597800000000','1.75971000000000','Peter Okot - LCIII -777646193',NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,'Dirt Road',NULL,NULL,'A good location for security, with the polic post just 100m away and also good for solar as all nearby trees are away from the sun\'s arc. 3 cell towers in close proximity in amongst tall trees from 280dgr - 40dgr. Good elevation and an LoS back to Gulu 19.54km\'s away. Pictures demonstrate however that trees are in the way of the SS given the bearing, and it may be an issue. See pics for details - \'tb3\'. On the main Kitgum road, quite a tucked in site, trees on one side 16m tall and sc offices at 5m tall on the other side.  Just in case it\'s not feasible, we did take a secondary GPS across the road, where security is worse, but LoS may be better -   2.898910°  32.455965°',4,'2013-01-31 17:47:00',NULL),(222,'Unyama Teachers College','UNYA2','2.82141900000000','32.33769000000000','1.75446000000000',NULL,NULL,NULL,9,27,14,4,NULL,NULL,1,6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'A good open site, with wide sweeping views, including a direct one to Gulu SS 4.26km away. LoS is limited on some sides as vegetation gets in the way. While views are good to the south, certain tree positions affects los to the north and Paicho/Cwero. Adjacent to the gps site is a powerline with a bearing of 152dgr - starting 20m from the gps. From 225dgr to 270dgr there\'s a ridge that affect los down to 2km. Extra gps\' have been taken at the powerline and the north side of the complex, titled \'unyama site 2\'   2.822028°  32.338755°, plus a water tower nearby   2.819813°  32.340559°  that could be used as a relay only (no real chance of a site). Alin have suggested 4 containers instead of 2 here given the prime location. Power line base GPS -   2.821223°  32.337637° \r\n\r\n*****This site replaces Unyama sub county office****',4,'2013-02-14 11:57:35',NULL),(224,'Truk Stop Tower','TRUK','7.44167200000000','151.83903400000000','0.00000000000000',NULL,1,NULL,9,38,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-01-31 16:12:33',NULL),(225,'Udot School','UDOT','7.38426700000000','151.71869400000000','4.24335000000000',NULL,1,NULL,9,40,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-01-31 16:22:40',NULL),(227,'PatikoHP2','PATHP2','3.01516200000000','32.32265900000000','1.78300000000000','Kilara a Kating -- +256 713177445',1,NULL,9,27,14,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,'This site is about 100m from where the containers are to be located.  This would most likely have to be a stand alone site with solar power and a short NanoStation link to the containers.',NULL,NULL,NULL,NULL,'The nature of Patiko means that LoS is only 200m in all direcetions due to the high vegetation. A number of >10m trees but in other site LoS\'s they are down to 5 or 6 m\'s. The police post is just across the road, 40m\'s away. Zaippi still looks tough to hit with the large obstruction at 314dgr. Site would need \'brush\' clearance, but ideal for solar and Orange gets 3/5 bars on the GSM. ',4,'2013-02-04 16:58:36',NULL),(228,'Laroo','LAROO','2.77708600000000','32.30016100000000','0.00000000000000','n/a',1,NULL,9,26,14,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Laroo is one of the 4 divisions of Gulu, and its sub-county office is situated down-town. Unlike outside of Gulu, we actually have plenty of Masts and data beaming points. Taso, the building to the immediate west is beaming data back into town, and Radio Maria - linked to Bosco - is less than 1 km away to the south. Photo\'s have been taken to show this. Good for solar and security, police post on site. Interestingly, Orange gets 5/5 for connectivity on the modem in case the coverage map comes up with a blank. It\'s a crucial site, located centrally and would be a great addition to the town. Powerlines run adjacent to the best spot for a mast, but teaming up with Bosco would eradicate the need as LoS is excellent to the south. There\'s a 15m billboard on the edge of the compound, and this could serve a purpose for extra height if needed. It would erradicate the need of a tower. Small compound, but open enough for 4 containers, given the proximity to population. ',4,'2013-02-05 10:31:02',NULL),(229,'Opit','OPIT','2.61318400000000','32.47410400000000','1.71478000000000','No Contact found',1,NULL,9,26,14,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'We tried to hit the red shading but there were no suitable places within. A very heavily vegatated town, but the location is the Parish, which sits atop a rise, before a view across to the 5th pic - nearest high point. A lot of buildings also at the complex, but none over 3m tall, so shouldn\'t be an issue. We\'re meeting with Bosco to see if the high point has a tower from them on it, which we could share. We noticed about 5 towers on it. Bobbi is at 241dgr, and the hilltop at 252dgr. Paicho is 31km\'s away, and affected by 15m trees directly north of the proposed site. I\'m aware that this site is not in the coverage map, but the town has a lot of potential for this project and if we require a relay at the HP, then i\'d recommend doing what we can to secure the site. Please note the powerlines running north/south at a 0-180dgr bearing. These are 10m\'s west of the site gps. Photo\'s are numbered for clarity. Solar and security both positive, with clear LoS from 270dgr coming south to 90dgr. 5 photo\'s were taken at each corner of the compound for an idea of the perimeter, and the kml\'s also. The first 4 are the bearings, the 5th is the shot to high point. I\'ve condensed the names as it\'s very time consuming, but if you want the db files to match exactly to the site survey, please let me know and i\'ll type them name for name. No tall buildings to note down for the photo\'s.',4,'2013-02-05 10:57:25',NULL),(240,'testsite1','TST1',NULL,NULL,NULL,NULL,1,NULL,9,0,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,13,'2013-02-26 18:36:29',NULL),(241,'Parem-approx','PAREM','7.36198414509864','151.78991299082670','4.26182000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 10:01:28',NULL),(242,'Fefan-approx','FEFAN','7.35020005184618','151.84078290652500','4.27570000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 10:00:12',NULL),(243,'Tol-approx','TOL','7.36607310690606','151.62596214934770','4.22213000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 10:00:56',NULL),(244,'Romonum-approx','ROMON','7.40820391425898','151.67295365219770','4.22294000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 10:01:39',NULL),(245,'Eot-approx','EOT','7.38525983855817','151.73748526375800','4.24367000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 09:59:56',NULL),(246,'Totiw-Approx','TOTIW','7.34095071517794','151.78167877821600','4.26374000000000',NULL,1,NULL,9,46,NULL,NULL,NULL,NULL,1,7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,10,'2013-02-28 10:01:14',NULL);
